import React, {useState, useEffect} from 'react'
import axios from 'axios'
import Cafe from './'

const CafeList = () => {
    const [cafe, setCafe] = useState([])

    useEffect(() => {
        axios.get('/all-cafes')
        .then(cafe => {
            setCafe(cafe.data)
        })
        .catch(err => {
            console.log(err)
        })
    },[])

    return(
        <div>
            <h1>
                This is the cafe list
            </h1>
        </div>
    )
}

export default CafeList
